  true,\n\t\"url\": null,\n\t\"notes\": \"Links to EDX for the MT data collected in
  support of the DOE GTO 4D EGS monitoring project. nn--Daily production reports--
  Oregon State University (OSU) had 6 stations running continuously. n--Dynamic survey
  map, KML file with MT locations on the west flank. Read off at location, created
  excel file for locations of each NBL. Zonge has two N-S lines of MT stations, 1-x
  and 2-x. Created excel file for locations of each 1-x and 2-x. n--In stations, each
  station has day file with calibration of magnetometers, 6 channels. .Z3d are proprietary
  data files (refer to Zonge Int'l) n--MT Section: has four channels that went into
  it, in edi format are given frequenices, coordinate system. Tensor-- four elements
  of this tensor at each frequency. The tensor is complex-valued-- it has a real part
  and an imaginary part at each frequency. In .zxr the impedance sensor relates N-S
  to E-W. \"r\" is imaginary. \"ZXYVAR\" is variance, error on each impedance tensor.
  Transmuted into apparent resistivity \"ro\". phase.n\",\n\t\"license_title\": \"Creative
